import React, { Component } from "react"
import ReactDOM from "react-dom"

export default class App extends Component() {
  constructor() {
    super()
    this.state = {
      greet: "hey"
    }
  }

  render() {
    return (
      <div>
        <h1>{this.state.greet}</h1>
      </div>
    )
  }
}

ReactDOM.render(<App />, document.querySelector("#root"))
